Using a similar approach to the custom sort function, we first need to implement our own sorting algorithm. We will use bubble sort for this. Bubble sort repeatedly steps through the list, compares adjacent elements and swaps them if they are in the wrong order. The pass through the list is repeated until no more swaps are needed, i.e., the list is sorted.

We apply the bubble sort algorithm to our array of transactions. 
```javascript
function bubbleSort(arr) {
  for (let i = arr.length - 1; i > 0; --i) {
    for (let j = 0; j < i; ++j) {
      if (arr[j] > arr[j + 1]) {
        const temp = arr[j];
        arr[j] = arr[j + 1];
        arr[j + 1] = temp;
      }
    }
  }
  return arr;
}
