# Step 1: Categorize expenses into essentials, savings, and discretionary spending
class Expense():
  def __init__(self, category, amount):
    self.category = category
    self.amount = amount

essential_expenses = []
savings_expenses = []
discretionary_expenses = []

# Step 2: Allow users to input their monthly income and distribute it across these categories
monthly_income = float(input("Enter your monthly income: "))

percentages = {'Essentials': 0.6, 'Savings': 0.2, 'Discretionary': 0.2}

for category, percentage in percentages.items():
  expense = Expense(category, monthly_income * percentage)
  if category == 'Essentials':
    essential_expenses.append(expense)
  elif category == 'Savings':
    savings_expenses.append(expense)
  else:
    discretionary_expenses.append(expense)

# Step 3: Suggest percentages for each category based on best practices
# These percentages can be adjusted as needed based on individual circumstances and financial goals
recommended_percentages = {'Essentials': 0.7, 'Savings': 0.3, 'Discretionary': 0}

# Adjust the suggested percentages if the user has already categorized their expenses
if len(essential_expenses) > len(recommended_percentages['Essentials'] * monthly_income):
  recommended_percentages['Essentials'] = (len(essential_expenses) - len(recommended_percentages['Essentials'] * monthly_income)) / len(monthly_income)

if len(savings_expenses) > len(recommended_percentages['Savings'] * monthly_income):
  recommended_percentages['Savings'] = (len(savings_expenses) - len(recommended_percentages['Savings'] * monthly_income)) / len(monthly_income)

if len(discretionary_expenses) > len(recommended_percentages['Discretionary'] * monthly_income):
  recommended_percentages['Discretionary'] = (len(discretionary_expenses) - len(recommended_percentages['Discretionary'] * monthly_income)) / len(monthly_income)

# Step 4: Provide a simple interface for tracking and adjusting expenses throughout the month
class Budget():
  def __init__(self):
    self.expenses = []

  def add_expense(self, expense):
    self.expenses.append(expense)

  def adjust_expense(self, expense):
    for i in range(len(self.expenses)):
      if self.expenses[i].category == expense.category:
        self.expenses[i] = expense

  def get_total_expense(self):
    total = 0
    for expense in self.expenses:
      total += expense.amount
    return total

  def update_budget(self, income):
    if len(self.expenses) > 0:
      adjusted_income = income - self.get_total_expense()
      for expense in self.expenses:
        if expense.category == 'Savings':
          expense.amount *= (1 + recommended_percentages[expense.category])
        elif expense.category == 'Discretionary':
          expense.amount *= (1 - recommended_percentages['Discretionary'])
        adjusted_income -= expense.amount
      self.update_budget(adjusted_income)

  def generate_summary_report(self):
    total_expense = self.get_total_expense()
    if total_expense > monthly_income:
      print("You have exceeded your income for this month.")
    else:
      print(f"Your expenses for this month are as follows:\nEssentials: ${total_expense * recommended_percentages['Essentials']:.2f}\nSavings: ${total_expense * recommended_percentages['Savings']:.2f}\nDiscretionary: ${total_expense * recommended_percentages['Discretionary']:.2f}")
    print(f"Your total expenses for this month are {total_expense:.2f}. You have ${"{:.2f}".format(monthly_income - total_expense)} left over." if total_expense < monthly_income else f"You have gone into debt by ${total_expense - monthly_income:.2f}.")

# Step 5: Generate a summary report of spending vs. income at the end of each month
