 Algorithm for finding the shortest path between two nodes in a graph using Dijkstra's algorithm:

1. Create an unordered dictionary `distances` to store the distances from the source node to all other nodes, and initialize it with infinite values except for the distance of the source node itself, which will be set as 0.
   Example: For a graph containing 5 nodes labeled A, B, C, D, and E where node A is the source node, we'll have distances = {A: 0, B: Infinity, C: Infinity, D: Infinity, E: Infinity}

2. Define a priority queue `queue` to store nodes based on their distances from the source node. The key for each node in the queue will be its distance. Initially, enqueue all adjacent nodes to the source node with their respective distances.
   Example: If A has edges to B with weight 5 and C with weight 4, then we'll have queue = {(B: 5), (C: 4)}

3. Extract the node with the smallest distance from `queue`.
   Example: Assuming that initially, B is the first node to be processed with a distance of 5 from A. After processing it, we'll have queue = {(C: 4)}

4. If the extracted node is the target node, return its path from the source node by reversing the path constructed so far. Otherwise, relax each edge connected to the node and update `distances` accordingly. Relaxing means if a neighbor of node with weighted distance less than its previous distance, update that distance in distances dictionary.
